INSERT INTO `algorithme` (`idAlgorithme`, `nom`, `description`) VALUES
(1, 'Analyse par seuillage et découpage', 'Transforme l\'image en niveau de gris, puis en image binaire. Enfin, il sépare un à un les différents noyaux détectés.'),
(2, 'Analyse par seuillage', 'Transforme l\'image en niveau de gris, puis en image binaire.'),
(3, 'Seuillage ovale pour microscope', 'Analyse une sélection ovale de l\'image, utile pour les images au microscope dans lesquelles on voit encore la lentille. Transforme ensuite en image binaire puis sépare les noyaux détectés.');
